metadata.description:
Kendime inanmayı ve güvenmeyi bilmeden önce ben belki de bir çizgiler yığınıydım içinde kalplerin, notaların, kitapların, kedilerin ve gözlüklerin olduğu. Şimdi seninle zihnimin içinde özgürce dolaşıyoruz. Sana bütün renklerimi göstermekten artık çekinmiyorum. Merhaba. Merhaba. 
//
Before I knew how to believe in and trust myself, maybe I had been a mass of lines which contained hearts, melodies, books, cats and glasses. Now, you and I are wandering inside my mind freely. I am no longer afraid of showing my colors to you. Hello. Hello.
